package com.jiagouedu.services.manage.attributelink.impl;import com.jiagouedu.core.ServersManager;import com.jiagouedu.services.manage.attributelink.AttributeLinkService;import com.jiagouedu.services.manage.attributelink.bean.AttributeLink;import com.jiagouedu.services.manage.attributelink.dao.AttributeLinkDao;import org.springframework.stereotype.Service;import javax.annotation.Resource;@Service("attributeLinkServiceManage")public class AttributeLinkServiceImpl extends ServersManager<AttributeLink, AttributeLinkDao>		implements AttributeLinkService {    @Resource(name = "attributeLinkDaoManage")    @Override    public void setDao(AttributeLinkDao attributeLinkDao) {        this.dao = attributeLinkDao;    }    @Override	public int deleteByCondition(AttributeLink e) {		return dao.deleteByCondition(e);	}}